(80, 'widget_text', 'a:12:{i:1;a:0:{}i:4;a:3:{s:5:"title";s:13:"About AirTaxi";s:4:"text";s:996:"AirTaxi.PH is the premier Private Helicopter and Jet Chartering service in the Philippines. It has over 16 jets and helicopters \r\nmanned with professionals that go the extra mile to garner the patronage of the Asian Business Community and \r\nInternational Multilateral Organizations.\r\n<br/><br/>\r\nAirTaxi.PH is owned and operated by <a href="asianaerospace.com.ph" target="_blank">Asian Aerospace Corporation</a>, the leading Business Aviation Company in the Philippines, which is also a licensed aircraft charter and aircraft maintenance company that implements the highest standards of safety for over 20 years.\r\n<br/>\r\n<br/>\r\n<div class="about-image">\r\n<div class="about-image-1 one-half first">\r\n<img src="http://airtaxi.teoj.testserver7.com/wp-content/uploads/2016/08/About-Us-Left-Image-2.png" alt="Helipad"/>\r\n</div>\r\n<div class="about-image-2 one-half">\r\n<img src="http://airtaxi.teoj.testserver7.com/wp-content/uploads/2016/08/About-Us-Right-Image-1.png" alt="Air Ambulance"/>\r\n</div>\r\n</div>";s:6:"filter";b:0;}i:5;a:3:{s:5:"title";s:14:"Aircraft Fleet";s:4:"text";s:278:"AirTaxi.PH lets you travel at your own time with its fleet of over 16 different Jets and Helicopters to fit your needs, \r\nwhether it be flights to another country, island, or within the Metro.\r\n<br/>\r\n<br/>\r\n<strong>Click an aircraft for more information.</strong>\r\n<br/>\r\n<br/>";s:6:"filter";b:0;}i:6;a:3:{s:5:"title";s:0:"";s:4:"text";s:293:"<div class="base-locations-header">AirTaxi.PH</div> \r\n <div class="base-locations-subheader">Base Locations</div>\r\nwith Hangars and VIP Lounges\r\n<br/><br/>\r\n<div class="base-locations-container"><div id="base-locations" class="location-map" style="height: 640px; width: 640px">\r\n</div>\r\n</div>";s:6:"filter";b:0;}i:7;a:3:{s:5:"title";s:10:"Membership";s:4:"text";s:779:"<h1>Advantages</h1>\r\n<br/>\r\n<br/>\r\n<div class="membership-table">\r\n<div class="one-third first">\r\n<h4>Priority Access and Discounts</h4>\r\nAirTaxi.PH lets you travel at your own time with its fleet of over 16 different Jets and Helicopters to fit your mission, whether it be flights to another country, island, or within the Metro.\r\n</div>\r\n<div class="one-third">\r\n<h4>Nationwide Coverage</h4>\r\nAirTaxi.PH operates all over the Philippines and has Private Terminals in Manila, Clark, Cebu, Davao, and Boracay Island and is currently expanding to more areas.\r\n</div>\r\n<div class="one-third">\r\n<h4>Fly it like you own it</h4>\r\nAirTaxi.PH Membership is perfect for potential aircraft buyers, especially to those who prefer affordable and hassle-free private flights.\r\n</div>\r\n</div>";s:6:"filter";b:0;}i:8;a:3:{s:5:"title";s:5:"Rates";s:4:"text";s:1991:"<div class="rates-table">\r\n<div class="one-fourth first">\r\n<h2>Manila</h2>\r\n<img src="http://airtaxi.teoj.testserver7.com/wp-content/uploads/2016/08/Rates-Manila.png" alt="Rates Manila"/><ul>\r\n<li><a href="http://airtaxi.teoj.testserver7.com/manila/"><div class="rates-table-link">Drop off or Pick Up</div></a></li>\r\n<li><a href="http://airtaxi.teoj.testserver7.com/manila/"><div class="rates-table-link">Aerial Tours</div></a></li>\r\n<li><a href="http://airtaxi.teoj.testserver7.com/manila/"><div class="rates-table-link">Destination Tour Packages</div></a></li>\r\n</ul>\r\n</div>\r\n<div class="one-fourth">\r\n<h2>Cebu</h2>\r\n<img src="http://airtaxi.teoj.testserver7.com/wp-content/uploads/2016/08/Rates-Cebu.png" alt="Rates Cebu"/>\r\n<ul><li><a href="http://airtaxi.teoj.testserver7.com/cebu/"><div class="rates-table-link">Drop off or Pick Up</div></a></li>\r\n<li><a href="http://airtaxi.teoj.testserver7.com/cebu/"><div class="rates-table-link">Aerial Tours</div></a></li>\r\n<li><a href="http://airtaxi.teoj.testserver7.com/cebu/"><div class="rates-table-link">Destination Tour Packages</div></a></li>\r\n</ul>\r\n</div>\r\n<div class="one-fourth">\r\n<h2>Boracay</h2>\r\n<img src="http://airtaxi.teoj.testserver7.com/wp-content/uploads/2016/08/Rates-Boracay.png" alt="Rates Boracay"/><ul>\r\n<li><a href="http://airtaxi.teoj.testserver7.com/boracay/"><div class="rates-table-link">Drop off or Pick Up</div></a></li>\r\n<li><a href="http://airtaxi.teoj.testserver7.com/boracay/"><div class="rates-table-link">Aerial Tours</div></a></li>\r\n<li><a href="http://airtaxi.teoj.testserver7.com/boracay/"><div class="rates-table-link">Destination Tour Packages</div></a></li>\r\n</ul>\r\n</div>\r\n<div class="one-fourth rates-more">\r\n<h2>and more!</h2>\r\n<img src="http://airtaxi.teoj.testserver7.com/wp-content/uploads/2016/08/Rates-More.png" alt="Rates More"/>\r\n<ul><li>Other locations\r\navailable\r\nupon request.</li>\r\n<li class="rates-inquire"><a href="http://airtaxi.teoj.testserver7.com/#home-section-6">Inquire Here</a></li>\r\n</ul>\r\n</div>\r\n</div>";s:6:"filter";b:0;}i:12;a:3:{s:5:"title";s:0:"";s:4:"text";s:74:"<div class="quote">We’ll fly you ahead and above of everyone else.</div>";s:6:"filter";b:0;}i:13;a:3:{s:5:"title";s:0:"";s:4:"text";s:233:"<div class="call-now">Call us now: <span class="dashicons dashicons-phone"></span><a href="+63-2-628-8900">+63 2 628 8900</a>  <span class="dashicons dashicons-smartphone"></span>	<a href="+63-908-818-9999">+63 908 818 9999</a></div>";s:6:"filter";b:0;}i:14;a:3:{s:5:"title";s:2:"hi";s:4:"text";s:5:"hello";s:6:"filter";b:0;}i:15;a:3:{s:5:"title";s:0:"";s:4:"text";s:0:"";s:6:"filter";b:0;}i:16;a:3:{s:5:"title";s:0:"";s:4:"text";s:740:"<footer>\r\n                <div class="footer-container">\r\n                    <div class="footer-logo left">\r\n                        <img width="200px" src="http://airtaxi.teoj.testserver7.com/wp-content/uploads/2016/09/AIRTAXI.png" alt="AirTaxi.PH"/>\r\n                        <small>© Copyright 2016. All Rights Reserved. Designed and Developed by 7th Media</small>\r\n                    </div>\r\n\r\n                    <div class="footer-links right">\r\n                    <a href="" class="footer-link facebook"><i class="fa fa-facebook-official fa-2x"></i></a>\r\n                    <a href="" class="footer-link instagram"><i class="fa fa-instagram fa-2x"></i></a>\r\n                    </div>\r\n                </div>\r\n            </footer>";s:6:"filter";b:0;}s:12:"_multiwidget";i:1;}', 'yes'),
